declare module '*.vue' {
  import Vue from 'vue';
  export default Vue;
}
declare module '*.png' {
  const png: any;
  export default png;
}
declare module '*.jpeg' {
  const jpeg: any;
  export default jpeg;
}
declare module '*.jpg' {
  const jpg: any;
  export default jpg;
}
declare module '*.svg' {
  const svg: any;
  export default svg;
}
